import React from "react";
import Head from "next/head";
import Layout from "../components/Layout";

const Home = () => (
  <div>
    <Head>
      <title>Home</title>
      <link rel="icon" href="/favicon.ico" />
    </Head>

    <Layout>
      <h1>hello</h1>
    </Layout>
  </div>
);

export default Home;
